- input: "TEXT\x1CC00144147\x1C.TEXT\x1C\x1CF3XA\x1CThis Amended September 30, 2010
    Quarterly report is amended to show the revised year to date figures after a reduction
    of receipts totaling $52.50 on the June 2, 2010 pre-runoff report amended on 10/20/2010.
    \ The 12 day pre-election report was originally amended on August 8, 2010 to correct
    the duplicate entries made for 5/7/2010; but the automatic subsequent amendents
    were not properly closed.  This amendment corrects the year to date entries on
    the Amended September 30 Quarterly report originally filed on 10/8/2010.  The
    ($52.50) correction is for the individual receipts for T. Terrell for ($30.00)
    and J. Truhett for ($22.50).  Both members left the PAC in May and one extra payroll
    deduction was posted as receipts. This amendment results in the Total Receipts
    on line 19 rolling forward correctly to subsequent reports.\n"
